import React, { useState } from 'react';
import { useParams, useLocation } from 'react-router-dom';
import Navbar from '../components/navbar';
import Footer from '../components/footer';
import './registrationPage.css';

const RegistrationPage = () => {
  const { id } = useParams();
  const location = useLocation();
  const event = location.state?.event;

  const [formData, setFormData] = useState({
    name: '',
    phone: '',
    email: '',
    address: '',
    city: '',
    country: '',
    zip: ''
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Form Data:', formData);
    // Handle form submission
  };

  return (
    <div className="registration-container">
      <Navbar />
      <main className="registration-content">
        <div className="registration-grid">
          {/* Left Side - Registration Form */}
          <div className="registration-form">
            <h2>Register for {event?.title}</h2>
            <form onSubmit={handleSubmit}>
              <div className="registration-form-group">
                <input
                  type="text"
                  name="name"
                  value={formData.name}
                  onChange={handleInputChange}
                  placeholder="Full Name"
                  required
                />
              </div>
              <div className="registration-form-group">
                <input
                  type="tel"
                  name="phone"
                  value={formData.phone}
                  onChange={handleInputChange}
                  placeholder="Phone Number"
                  required
                />
              </div>
              <div className="registration-form-group">
                <input
                  type="email"
                  name="email"
                  value={formData.email}
                  onChange={handleInputChange}
                  placeholder="Email Address"
                  required
                />
              </div>
              <div className="registration-form-group">
                <input
                  type="text"
                  name="address"
                  value={formData.address}
                  onChange={handleInputChange}
                  placeholder="Street Address"
                  required
                />
              </div>
              <div className="registration-form-row">
                <div className="registration-form-group">
                  <input
                    type="text"
                    name="city"
                    value={formData.city}
                    onChange={handleInputChange}
                    placeholder="City"
                    required
                  />
                </div>
                <div className="registration-form-group">
                  <input
                    type="text"
                    name="zip"
                    value={formData.zip}
                    onChange={handleInputChange}
                    placeholder="ZIP Code"
                    required
                  />
                </div>
              </div>
              <div className="registration-form-group">
                <input
                  type="text"
                  name="country"
                  value={formData.country}
                  onChange={handleInputChange}
                  placeholder="Country"
                  required
                />
              </div>
              <button type="submit" className="registration-submit-button">
                Register Now
              </button>
            </form>
          </div>

          {/* Right Side - Event Details */}
          <div className="registration-event-details">
            <div className="registration-event-image-container">
              <img src={event?.image} alt={event?.title} className="registration-event-image" />
            </div>
            <div className="registration-event-info">
              <h3>{event?.title}</h3>
              <p className="registration-event-description">{event?.description}</p>
              <div className="registration-event-meta">
                <p><strong>Date:</strong> {event?.date}</p>
                <p><strong>Time:</strong> {event?.time}</p>
                <p><strong>Location:</strong> {event?.location}</p>
              </div>
            </div>
          </div>
        </div>
      </main>
      <Footer />
    </div>
  );
};

export default RegistrationPage;
